import React, { Component } from "react";
// import {BrowserRouter as Router, Route, Link, NavLink} from 'react-router-dom';
// import Home from './components/Home'
import ZipCode from './components/ZipCode'
let API_KEY = "1ba52e2d0b10783cca990ba43e51f792";

//http://api.openweathermap.org/data/2.5/forecast?id=524901&APPID={APIKEY}

let URL = `http://api.openweathermap.org/data/2.5/`;

export default class App extends Component {
  constructor(props) {
    super(props);

    this.state = {
      zipcode: "",
      weather: []
    };
  }

  handleZipcodeSubmit = () => {
    this.props.onSubmitZipcode(this.state.zipcode);
    this.setState({
      zipcode: ""
    });
  };

  handleZipcodeUpdate = e => {
    let zip = e.target.value;

    this.setState({
      zipcode: zip
    });
  };

  componentDidMount() {
    fetch(`${URL}zip=${this.state.zipcode}`)
    .then
  }

  render() {
    return (
      <ZipCode zipcode={this.state.zipcode} handleZipcodeUpdate={this.handleZipcodeUpdate} handleZipcodeSubmit={this.handleZipcodeSubmit}/>
    );
  }
}
